function checkCashRegister(price, cash, cid) {
  // Variables
  var change = cash - price;
  var baseChange = parseFloat((cash - price).toFixed(2));
  var cashInDrawer = cid.reverse();
  var cashInDrawerValue = 0;
  var changeRegister = [];
  var changeRegisterValue = 0;
  // Functions
  var sumCashRegisterValue = function(arr) {
    var value = 0;
    for(var y = 0; y < arr.length; y++) {
      if(arr[y][0] !== undefined) {
        value += arr[y][1];
      }
    }
    return parseFloat(value.toFixed(2));
  }
  cashInDrawerValue = sumCashRegisterValue(cashInDrawer);

  // Find change
  if(cashInDrawerValue > baseChange) {
    for(var i = 0; i < cashInDrawer.length; i++) {

      if(cashInDrawer[i][0] === "ONE HUNDRED" && change >= 100 && cashInDrawer[i][1] >= 100) {
        if(cashInDrawer[i][1] >= change) {
          changeRegister.push(["ONE HUNDRED", change - change % 100]);
          change = parseFloat((change % 100).toFixed(2));
        }
        else {
          changeRegister.push(["ONE HUNDRED", cashInDrawer[i][1]]);
          change = parseFloat((change - cashInDrawer[i][1]).toFixed(2));
        }
      }
      if(cashInDrawer[i][0] === "TWENTY" && change >= 20 && cashInDrawer[i][1] >= 20) {
        if(cashInDrawer[i][1] >= change) {
          changeRegister.push(["TWENTY", change - change % 20]);
          change = parseFloat((change % 20).toFixed(2));
        }
        else {
          changeRegister.push(["TWENTY", cashInDrawer[i][1]]);
          change = parseFloat((change - cashInDrawer[i][1]).toFixed(2));
        }
      }
      if(cashInDrawer[i][0] === "TEN" && change >= 10 && cashInDrawer[i][1] >= 10) {
        if(cashInDrawer[i][1] >= change) {
          changeRegister.push(["TEN", change - change % 10]);
          change = parseFloat((change % 10).toFixed(2));
        }
        else {
          changeRegister.push(["TEN", cashInDrawer[i][1]]);
          change = parseFloat((change - cashInDrawer[i][1]).toFixed(2));
        }
      }
      if(cashInDrawer[i][0] === "FIVE" && change >= 5 && cashInDrawer[i][1] >= 5) {
        if(cashInDrawer[i][1] >= change) {
          changeRegister.push(["FIVE", change - change % 5]);
          change = parseFloat((change % 5).toFixed(2));
        }
        else {
          changeRegister.push(["FIVE", cashInDrawer[i][1]]);
          change = parseFloat((change - cashInDrawer[i][1]).toFixed(2));
        }
      }
      if(cashInDrawer[i][0] === "ONE" && change >= 1 && cashInDrawer[i][1] >= 1) {
        if(cashInDrawer[i][1] >= change) {
          changeRegister.push(["ONE", change - change % 1]);
          change = parseFloat((change % 1).toFixed(2));
        }
        else {
          changeRegister.push(["ONE", cashInDrawer[i][1]]);
          change = parseFloat((change - cashInDrawer[i][1]).toFixed(2));
        }
      }
      if(cashInDrawer[i][0] === "QUARTER" && change >= 0.25 && cashInDrawer[i][1] >= 0.25) {
        if(cashInDrawer[i][1] >= change) {
          changeRegister.push(["QUARTER", change - change % 0.25]);
          change = parseFloat((change % 0.25).toFixed(2));
        }
        else {
          changeRegister.push(["QUARTER", cashInDrawer[i][1]]);
          change = parseFloat((change - cashInDrawer[i][1]).toFixed(2));
        }
      }
      if(cashInDrawer[i][0] === "DIME" && change >= 0.1 && cashInDrawer[i][1] >= 0.1) {
        if(cashInDrawer[i][1] >= change) {
          changeRegister.push(["DIME", change - change % 0.1]);
          change = parseFloat((change % 0.1).toFixed(2));
        }
        else {
          changeRegister.push(["DIME", cashInDrawer[i][1]]);
          change = parseFloat((change - cashInDrawer[i][1]).toFixed(2));
        }
      }
      if(cashInDrawer[i][0] === "NICKEL" && change >= 0.05 && cashInDrawer[i][1] >= 0.05) {
        if(cashInDrawer[i][1] >= change) {
          changeRegister.push(["NICKEL", change - change % 0.05]);
          change = parseFloat((change % 0.05).toFixed(2));
        }
        else {
          changeRegister.push(["NICKEL", cashInDrawer[i][1]]);
          change = parseFloat((change - cashInDrawer[i][1]).toFixed(2));
        }
      }

      if(cashInDrawer[i][0] === "PENNY" && change >= 0.01 && cashInDrawer[i][1] >= 0.01) {
        if(cashInDrawer[i][1] >= change) {
          changeRegister.push(["PENNY", change]);
        }
        else {
          changeRegister.push(["PENNY", cashInDrawer[i][1]]);
        }
      }
    }
  }

  changeRegisterValue = sumCashRegisterValue(changeRegister);

  if(baseChange == cashInDrawerValue) {
    return {status: "CLOSED", change: cashInDrawer.reverse()};
  }
  if(baseChange == changeRegisterValue) {
    return {status: "OPEN", change: changeRegister};
  }
  return {status: "INSUFFICIENT_FUNDS", change: []};
}
